import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Login from "./Login";
import SignUp from "./SignUp";
import UserProfile from "./UserProfile";

function AppRouter() {
  const user = null;
  return (
        user ?
        <UserProfile />
      :
        <Router>
          <SignUp path="/signup" />
          <Login path="/login" />
        </Router>

  );
}
export default AppRouter;
